import React from 'react';
import {
	Grid,
	GridItem,
	Box,
} from '@chakra-ui/react';

const MainPage = () => {
	return (
		<Grid templateColumns='repeat(10, 1fr)' gap={3}>
			<Box colSpan={3} bg='teal'></Box>
		</Grid>
	)
}

export default MainPage;
